script: |
  super -f text -I q1405.spq | sort > q1405.out

inputs:
  - name: q1405.spq
    data: |
      SELECT DISTINCT + col2 - + col0 + + 0 + - - col2 + + - 34 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NULL ) NOT BETWEEN + - ( + CAST ( - + ( + col1 ) AS REAL ) ) AND - ( + + 17 ) * col1 - - 50;
  - name: tab1

outputs:
  - name: q1405.out
    data: |
